import React from 'react';

class Section3 extends React.Component{
	constructor(props){
	   super(props);	
	}

    render() {
        return (
            <div>
                Nome:
                <input 
                    type="text"
                    id="nomeDaAggiungere"
                />
                Numero:
                <input 
                    type="text"
                    id="numeroDaAggiungere"
                /> 
                <button 
                    onClick={this.props.aggiungi}
                >
                Aggiungi
                </button> 
            </div>
        );
    }

}
export default Section3;
